// import sleep from 'sleep-promise'
import Layout from '~/components/layout/Layout'
import FormGroup from '~/components/layout/AuthModal/FormGroup'
import Label from '~/components/layout/AuthModal/Label'
import Input from '~/components/layout/AuthModal/Input'
import { useContext, useState } from 'react'
import withAuth from '~/components/withAuth'
import { IS_PRODUCTION } from "~/constants/constants";
import UserContext from "~/contexts/UserContext";

const UserDataForm = ({ downloadLink, layoutProps, link }) => {

  const [values, setValues] = useState({
    name: '',
    gender_id: '',
    document: '',
    country_id: '',
    address_1st_level: '',
    city: '',
    address_3rd_level: '',
    address: '',
    package_id: '',
    payment_method_id: null,
    payment_os: null,
    cash_payment_method_id: null,
    terms: null,
    discount_id: null,
  })

  const debug = false && !IS_PRODUCTION
  const requireds = IS_PRODUCTION

  const { user, updateUser } = useContext(UserContext)

  const [genders, setGenders] = useState()
  const [discounts, setDiscounts] = useState(false)
  const [blockDiscountFields, setBlockDiscountFields] = useState(false)

  const [loading, setLoading] = useState()
  const [error, setError] = useState()

  const InvalidFeedback = ({ error, loading, name }) => {
    return (
      <>
        { !loading && error && error.errors && error.errors[name] && (
          <div className="invalid-feedback">{ error.errors[name] }</div>
        ) }
      </>
    )
  }


  return (
    <Layout { ...layoutProps }>
      <div className="register-confirm container text-center">

        <h1>Seus dados</h1>

        <div className="col-md-6 offset-3">
          <FormGroup>
            <Label htmlFor="name">Nombre completo</Label>
            <Input
              id="name"
              name="name"
              value={ values.name }
            />
            <InvalidFeedback error={ error } loading={ loading } name="name"/>
          </FormGroup>
          <FormGroup>
            <Label htmlFor="name">Nombre completo</Label>
            <Input
              id="name"
              name="name"
              value={ values.name }
            />
            <InvalidFeedback error={ error } loading={ loading } name="name"/>
          </FormGroup>
        </div>

      </div>
    </Layout>
  )

}


export default withAuth(UserDataForm, true);
